import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="container">
      <div className="form-container">
         <h2 class="cedarville-cursive-regular">Jade and Seka Wedding Website</h2>
        <input placeholder='Please enter your Full Name to access the site'></input>
        <button>Submit</button>
      </div>
    </div>
  );
}

export default App;
